import React, { useEffect } from 'react';
import Blogpost from '../../../data.json';

function Post(props) {
  const post = Blogpost.data;
  return (
    <div>
      {post.map((post) => {
        <h1>{post.blogTitle}</h1>;
      })}
    </div>
  );
}

export default Post;
